import { useEffect, useState } from "react";
import { useLocation } from "react-router-dom";
import { DB, COMETA } from "../CONST";

function Detalle() {
	const lugar = useLocation().pathname.split("detalle/")[1];
	console.log( lugar );
	
	useEffect(() => {
		fetch( DB ).then( x => x.json() ).then( x => {
			const resumen = x.values[lugar];
			const p = {
				id: resumen[0],
				nombre: resumen[1],
				precio: (Number(resumen[2])+COMETA).toLocaleString("es-CL"),
			};
		});
	},[]);
	
	return (
		<section id="detalle">
			<h1>[{lugar}] asd</h1>
			<h3>$ {p.precio}</h3>
		</section>
	)
}
export default Detalle;
